import { link } from 'fs';
import React, { useEffect } from 'react';
import ISidebar from '../../interfaces/ISidebar';

interface Props {
  sidebar: ISidebar;
}

const Sidebar = ({ sidebar: { title, logoPath, links } }: Props) => {

  const dummyData = [
    {
      id: 1,
      title: 'buffalo',
      subtitle: 'striploin'
    },
    {
      id: 2,
      title: 'breezer',
      subtitle: 'tropical'
    }
  ];

  const RenderCard = () => {
    return (
      dummyData.map(
        (d) => {
          return <div key={d.id} title={d.title}></div>
        }
      )
    )
  }

  return (
    <>
      <div>
        <RenderCard />
      </div>
    </>
  )
}

export default Sidebar;
